import { CodeIcon, PrinterIcon } from "@phosphor-icons/react";
import type { Meta, StoryObj } from "@storybook/react-vite";
import { printcss } from "../";
import { Button, Grid } from "../react";

const base64imgSrc =
	"data:image/jpeg;base64,";

const meta = {
	id: "designsystem-print",
	title: "Designsystem/Print (Eksperimentell)",
	parameters: {
		layout: "fullscreen",
	},
	decorators: [
		(Story) => (
			<>
				<style>{`
					#example-buttons { position: fixed; top: 1rem; left: 1rem; z-index: 1000 }
					body:has(.sbdocs-content) #example-buttons { display: none }
					@media print { #example-buttons { display: none } }
				`}</style>
				<Grid id="example-buttons" data-size="sm" data-gap="2">
					<Button
						data-justify="start"
						data-variant="primary"
						onClick={() => {
							if (window.top === window.self) return window.print();
							const win = window.open("");
							const htm = document.getElementById("my-print")?.innerHTML || "";
							win?.document.body.insertAdjacentHTML("beforeend", htm);
							win?.print();
						}}
					>
						<PrinterIcon /> Se print-preview i Chrome
					</Button>
					<div>
						<Button
							data-justify="start"
							data-variant="primary"
							onClick={() => {
								const win = window.open("");
								const htm =
									document.getElementById("my-print")?.innerHTML || "";
								const pre = document.createElement("pre");
								pre.textContent = htm;
								win?.document.body.appendChild(pre);
							}}
						>
							<CodeIcon /> Se HTML
						</Button>
					</div>
				</Grid>
				<Story />
			</>
		),
	],
} satisfies Meta;

export default meta;
type Story = StoryObj<typeof meta>;

